jQuery.ketchup.validation("required","This field is required.",function(c,b,d){var a=b.attr("type").toLowerCase();if(a=="checkbox"||a=="radio"){return(b.attr("checked")==true);
}else{return(d.length!=0);}}).validation("minlength","This field must have a minimal length of {arg1}.",function(c,b,d,a){return(d.length>=+a);}).validation("maxlength","This field must have a maximal length of {arg1}.",function(c,b,d,a){return(d.length<=+a);
}).validation("rangelength","This field must have a length between {arg1} and {arg2}.",function(d,c,e,b,a){return(e.length>=b&&e.length<=a);}).validation("min","Must be at least {arg1}.",function(c,b,d,a){return(this.isNumber(d)&&+d>=+a);
}).validation("max","Can not be greater than {arg1}.",function(c,b,d,a){return(this.isNumber(d)&&+d<=+a);}).validation("range","Must be between {arg1} and {arg2}.",function(d,c,e,b,a){return(this.isNumber(e)&&+e>=+b&&+e<=+a);
}).validation("number","Must be a number.",function(b,a,c){return this.isNumber(c);}).validation("digits","Must be digits.",function(b,a,c){return/^\d+$/.test(c);
}).validation("email","Must be a valid E-Mail.",function(b,a,c){return this.isEmail(c);}).validation("url","Must be a valid URL.",function(b,a,c){return this.isUrl(c);
}).validation("username","Must be a valid username.",function(b,a,c){return this.isUsername(c);}).validation("match","Must be {arg1}.",function(b,a,c,d){return(a.val()==d);
}).validation("contain","Must contain {arg1}",function(b,a,c,d){return this.contains(c,d);}).validation("date","Must be a valid date.",function(b,a,c){return this.isDate(c);
}).validation("minselect","Select at least {arg1} checkboxes.",function(c,b,d,a){return(a<=this.inputsWithName(c,b).filter(":checked").length);},function(b,a){this.bindBrothers(b,a);
}).validation("maxselect","Select not more than {arg1} checkboxes.",function(c,b,d,a){return(a>=this.inputsWithName(c,b).filter(":checked").length);},function(b,a){this.bindBrothers(b,a);
}).validation("rangeselect","Select between {arg1} and {arg2} checkboxes.",function(e,c,f,b,a){var d=this.inputsWithName(e,c).filter(":checked").length;
return(b<=d&&a>=d);},function(b,a){this.bindBrothers(b,a);});